description:
Sex and Travel is the second album by British pop group Right Said Fred, released in 1993. It contains the UK top 60 singles &quot;Bumped&quot;, &quot;Hands Up (4 Lovers)&quot; and &quot;Wonderman&quot;. The album peaked at #35 on the UK Albums Chart.


