2.&quot;Bumped&quot;
3.&quot;It's Not the Way&quot;
4.&quot;She's My Mrs.&quot;
5.&quot;We Live a Life&quot;
6.&quot;Rocket Town
7.&quot;Turn Me On&quot;
8.&quot;Back to You&quot;
9.&quot;I Ain't Stupid&quot;
